Scratch.translate.setup({"zh-cn":{"_WBMODA":"王八moda"}});


(function (Scratch) {
    "use strict";
    const BlockType = Scratch.BlockType;
    const makeLabel = (text) => ({
        blockType: "label",
        text: text,
      });
    const blockIconURI ="data:image/png;base64,";
    class WBMODA {
      getInfo() {
        return {
          id: "wbmoda",
          color1: "#99FF00",
          blockIconURI: blockIconURI,
          name: Scratch.translate("WBMODA"),
          blocks: [
            makeLabel(Scratch.translate("文件操作类")),

            {
                opcode: "file_create",
                blockType: Scratch.BlockType.REPORTER,
                text: "创建文件夹 [PATH] ",
                arguments: {
                  PATH: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "绝对路径",
                  },
                },
            },
            {
                opcode: "file_read",
                blockType: Scratch.BlockType.REPORTER,
                text: "读取文件 [PATH] ",
                arguments: {
                  PATH: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "绝对路径",
                  },
                },
            },
            {
                opcode: "file_write",
                blockType: Scratch.BlockType.REPORTER,
                text: "写入文件 [PATH] 内容 [DATA]",
                arguments: {
                  PATH: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "绝对路径",
                  },
                  DATA: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "114514",
                  },
                },
            },
            {
                opcode: "file_delete",
                blockType: Scratch.BlockType.REPORTER,
                text: "删除文件 [PATH]",
                arguments: {
                  PATH: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "绝对路径",
                  },
                },
            },
            {
                opcode: "path_delete",
                blockType: Scratch.BlockType.REPORTER,
                text: "删除目录 [PATH]",
                arguments: {
                  PATH: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "绝对路径",
                  },
                },
            },
            {
                opcode: "getpath",
                blockType: Scratch.BlockType.REPORTER,
                text: "运行目录",
            },

            makeLabel(Scratch.translate("系统")),
            {
              opcode: "choosefile",
              blockType: Scratch.BlockType.REPORTER,
              text: "调用系统选择文件 初始路径 [PATH]",
              arguments: {
                PATH: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "绝对路径",
                },
              },
            },
            {
              opcode: "alerts",
              blockType: Scratch.BlockType.REPORTER,
              text: "调用系统弹窗 标题[TITLE] 内容[DATA]",
              arguments: {
                TITLE: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "警告",
                },
                DATA: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "114514入侵!",
                },
              },
            },
            {
              opcode: "message",
              blockType: Scratch.BlockType.REPORTER,
              text: "显示信息框[MSG]",
              arguments: {
                MSG: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "114514入侵!",
                },
              },
            },
            {
              opcode: "screenfx",
              blockType: Scratch.BlockType.REPORTER,
              text: "设置屏幕方向为[FX](1为横,2为纵)",
              arguments: {
                FX: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "1",
                },
              },
            },


            makeLabel(Scratch.translate("自定义指令(危险)")),


            {
              opcode: "privatetool",
              blockType: Scratch.BlockType.REPORTER,
              text: "自定义指令执行 [COM] 参数 [DATA]",
              arguments: {
                COM: {
                  type: Scratch.ArgumentType.STRING,
                  defaultValue: "指令",
                },
                DATA: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "参数",
                  },
              },
            },
            {
                opcode: "privateget",
                blockType: Scratch.BlockType.REPORTER,
                text: "自定义指令获取 [COM]",
                arguments: {
                  COM: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "指令",
                  },
                },
              },
              makeLabel(Scratch.translate("Android API(危险)")),
              {
                opcode: "shellrun",
                blockType: Scratch.BlockType.REPORTER,
                text: "Shell执行 [COM] 是否root [ROOT] 是否为文件[FILE]",
                arguments: {
                  COM: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "指令",
                  },
                  ROOT: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "1",
                  },
                  FILE: {
                    type: Scratch.ArgumentType.STRING,
                    defaultValue: "1",
                  },
                },
              },
          ],
        };
      }
      privatetool(args) {
        return Scratch.fetch(String("http://127.0.0.1:8080/"+args.COM), {
            method: "POST",
            headers:  {
                  "Content-Type":"text/plain" ,
                },
            redirect: "follow",
            body: String(args.DATA),
          })
        .then((r) => r.text())
        .catch((error) => {;
            return "王八插件安卓核心没有运行";
        });
      }

      privateget(args) {
        return Scratch.fetch(String("http://127.0.0.1:8080/"+args.COM), {
            method: "GET",
            headers:  {
                  "Content-Type":"text/plain" ,
                },
            redirect: "follow",
          })
        .then((r) => r.text())
        .catch((error) => {;
            return "王八插件安卓核心没有运行";
        });  
    }
    file_create(args) {
        const argss={}
        argss.COM="mkdir"
        argss.DATA=JSON.stringify({
            "path":args.PATH,
        })
        return this.privatetool(argss)
    }
    file_read(args) {
        const argss={}
        argss.COM="read"
        argss.DATA=JSON.stringify({
            "path":args.PATH,
        })
        return this.privatetool(argss)
    }
    file_write(args) {
        const argss={}
        argss.COM="create"
        argss.DATA=JSON.stringify({
            "path":args.PATH,
            "data":args.DATA,
        })
        return this.privatetool(argss)
    }
    file_delete(args) {
        const argss={}
        argss.COM="delete"
        argss.DATA=JSON.stringify({
            "path":args.PATH,
        })
        return this.privatetool(argss)
    }
    path_delete(args) {
        const argss={}
        argss.COM="delpath"
        argss.DATA=JSON.stringify({
            "path":args.PATH,
        })
        return this.privatetool(argss)
    }
    getpath(args) {
        const argss={}
        argss.COM="path"
        return this.privateget(argss)
    }
    choosefile(args) {
      const argss={}
      argss.COM="choosefile"
      argss.DATA=JSON.stringify({
        "path":args.PATH,
    })
      return this.privatetool(argss)
    }
    alerts(args) {
      const argss={}
      argss.COM="alert"
      argss.DATA=JSON.stringify({
        "title":args.TITLE,
        "data":args.DATA,
    })
      return this.privatetool(argss)
    }
    message(args) {
      const argss={}
      argss.COM="message"
      argss.DATA=JSON.stringify({
        "msg":args.MSG,
    })
      return this.privatetool(argss)
    }
    shellrun(args) {
      const argss={}
      argss.COM="shell"
      argss.DATA=JSON.stringify({
        "data":args.COM,
        "root":args.ROOT,
        "file":args.FILE,
    })
      return this.privatetool(argss)
    }
    screenfx(args) {
      const argss={}
      argss.COM="screenfx"
      argss.DATA=JSON.stringify({
        "fx":args.FX,
    })
      return this.privatetool(argss)
    }

    }
  
    Scratch.extensions.register(new WBMODA());
  })(Scratch);